notes:
Deze tabel bevat gegevens over verhuisde personen binnen gemeenten en tussen gemeenten in Nederland.

De gegevens zijn uit te splitsen naar:
Kerncijfers, aantallen en verhoudingscijfers per regio;
Binnen gemeenten verhuisde personen naar:
- gezinssituatie en regio (tot 2010);
- geslacht, leeftijd en regio;
- geslacht, burgerlijke staat en regio;
- geslacht, Nederlanderschap en regio.
Gevestigde personen naar:
- gezinssituatie en regio (tot 2010);
- geslacht, leeftijd en regio;
- geslacht, burgerlijke staat en regio;
- geslacht, Nederlanderschap en regio.
Vertrokken personen naar:
- gezinssituatie en regio (tot 2010);
- geslacht, leeftijd en regio;
- geslacht, burgerlijke staat en regio;
- geslacht, Nederlanderschap en regio.

De in de tabel opgenomen regio's zijn landsdelen, provincies, COROP-gebieden, stadsgewesten, grootstedelijke agglomeraties en gemeenten.

De gepresenteerde regiototalen betreffen samentellingen van gemeenten.
In geval van grenswijzigingen die over verschillende regiogrenzen heen gaan is de indeling van de gemeenten gegroepeerd naar de meest recente situatie.
Bijvoorbeeld: voor de gemeente Woerden, die per 01-01-1989 is overgegaan van de provincie Zuid-Holland naar de provincie Utrecht, geldt dat ze in de tabel is gegroepeerd in de provincie Utrecht.

Gegevens beschikbaar vanaf: 1988

Status van de cijfers:
Alle in de tabel opgenomen cijfers zijn definitieve cijfers.
De manier waarop de cijfers over verhuisde personen worden geproduceerd is in 2014 gewijzigd. Dit heeft tot gevolg dat de cijfers van verhuisde personen over 2013 in verschillende tabellen soms niet overeenkomen. De verschillen zijn minimaal en treden alleen op in 2013.

Wijzigingen per 2 juli 2014:
De cijfers over 2013 zijn toegevoegd. 

Wanneer komen er nieuwe cijfers?
In juli 2015 worden de definitieve cijfers over 2014 in deze publicatie opgenomen.
